window.bookSummaryJSON = "<p><b>See the world of&nbsp;</b><b><i>Fifty Shades of Grey</i></b><b>&nbsp;anew through the eyes of Christian Grey - a fresh perspective on the love story that has enthralled millions of listeners around the world.</b></p> <p><b>Look for E L James’ passionate new love story,&nbsp;</b><b><i>The Mister</i></b><b>, available now.</b>&nbsp;</p> <p>Their scorching, sensual affair ended in heartbreak and recrimination, but Christian Grey cannot get Anastasia Steele out of his mind, or his blood. Determined to win her back, he tries to suppress his darkest desires and his need for complete control, and to love Ana on her own terms.&nbsp;</p> <p>But the horrors of his childhood still haunt him, and Ana’s scheming boss, Jack Hyde, clearly wants her for himself.&nbsp;Can Christian’s confidant and therapist, Dr. Flynn, help him face down his demons? Or will the possessiveness of Elena, his seducer, and the deranged devotion of Leila, his former submissive, drag Christian down into the past?</p> <p>And if Christian does win Ana back, can a man so dark and damaged ever hope to keep her?</p> <p><b>This audiobook is intended for mature audiences.</b></p>"; 
